The most minimal example we could start with doesn't do anything except avoid crashing. Still, it's a useful way to check that our tools and project are configured properly. #![no_std]
#![no_main]
#![feature(naked_functions)] #[naked]
#[no_mangle]
#[instruction_set(arm::a32)]
#[link_section = ".text.gba_rom_header"]
unsafe extern "C" fn __start() -> ! { core::arch::asm! { "b 1f", ".space 0xE0", "1:", "b 1b", options(noreturn) }
} #[panic_handler]
fn handle_panic(_: &core::panic::PanicInfo) -> ! { loop {}
} You can put this in your project's examples/ directory. We'll call it min1.rs, and cargo run --example min1 should build the example and run it in your runner. If everything went fine, mGBA should open up and show a white screen and then do nothing, without any error messages. If there's any problems already that's okay! There's a lot of small details involved in something like this. When I was setting things up for this book, and trying to write this minimal example, I messed it up at least three times. Don't get discouraged too easily! Double check all the file names, all the file contents, what you typed in the command line, and so on. You can open an issue if you need to ask for help. Alternately, you can try asking in the GBA Dev Discord . Let's cover each part of the example one at a time.

11.body:
#![no_std]
#![no_main]
#![feature(naked_functions)] First we've got several "inner" attributes. They're like normal attributes but they go just inside of what they affect, rather than just outside of it. There's no way to have text "outside" of a file, so we have to use inner attributes here. Inner attributes always have to go first, before any other items like functions or structs or anything like that. The ordering of the attributes themselves doesn't matter, I just like sorting them from shortest to longest because it usually looks nice. First is no_std . This prevents the compiler from automatically linking our program with the std and alloc crates. The GBA doesn't support std at all, so we'd get a build error if we didn't have no_std. It's possible to use alloc, but we'd have to do more setup to make it work, so for now we can't. Even without std available, we can still use a fairly good amount of Rust through the core crate. Next is the no_main attribute. Normally Rust would provide the actual main symbol which the OS calls at the start of the process. That function does some environment setup and then calls the main function of the Rust code we wrote. The compiler doesn't know how to write a main for the GBA though. So, we just tell it to not even try, and we'll handle that ourselves. Finally, we have a Nightly feature: naked functions . Normally a function has the "prologue" and "epilogue" (the intro and outro) handled by the compiler. This is for the best, because among other things it's what allows inlining to work. However, on rare occasions we'll need to have the compiler step back and let us take complete control. With the naked_functions Nightly feature, we'll be able to use #[naked] on a function when needed.

13.body:
#[panic_handler]
fn handle_panic(_: &core::panic::PanicInfo) -> ! { loop {}
} Even if the program itself can't actually panic, Rust demands that you define a panic handler function. During compilation a panic handler that never gets called will be removed, the same as any function that's never called gets removed, but we have to define and then let the compiler decide for itself that it's unused. As our programs grow we might want to have a panic handler that does something with the panic info. Send a message to mGBA's debug output, or show something on the screen, or something like that. Right now we'll start with a "do nothing at all" panic handle though.

